import { makeStyles } from '@material-ui/styles';

const styles = makeStyles(() => ({
  custoPorPecContainer: {
    padding: '20px 30px'
  },
  tituloCustoPorPec: {
    fontSize: '20px',
    textAlign: 'center'
  },
  custoPorPec: {
    color: '#E35A50',
    fontSize: '36px',
    textAlign: 'center'
  },
  ultimasPecs: {},
  ultimasPecsTitulo: {
    background: '#8CBABE',
    color: 'white',
    fontSize: '21px',
    textAlign: 'center'
  },

  pec: {
    fontSize: '18px',
    border: '1px solid #CACACA',
    borderTop: 'none'
  }
}));

export default styles;
